//           "detailedDescription": "This study was a single-center,open-label,randomized,dose-exploring prospective study.Patients with granulocytotic aplastic anemia who received cytokine treatment with PEG-rhG-CSF or rhG-CSF were enrolled.Clinical demographic data,disease characteristics of aplastic anemia,clinical diagnosis and treatment,laboratory data and adverse events were collected to explore the dose and safety of PEG-rhG-CSF and rhG-CSF in patients with severe aplastic anemia.Research objectives: To explore the reasonable injection frequency of long-acting PEG-rhG-CSF in the adjuvant treatment of aplastic anemia patients with granulocytosis through a single center prospective clinical study.Disease classification of aplastic anemia: a total of 45 cases of SAA/VSAA with ANC\\<0.5Ã—109/L were stratified and randomized into three groups according to the radio of 1:1:1(15 cases in each group).PEG-rhG-CSF group A(q7d):6mg d1,8,subcutaneously injected;PEG-rhG-CSF group B(q10d):6mg d1,11,subcutaneously injected;RhG-CSF group(short-acting ): 480ug d1-14(daily for 14days),subcutaneously injected.Dose/protocol adjustment: after monitoring ANC\\>0.5Ã—109/L,the drug was stopped,and then ANC\\<0.5Ã—109/L was temporarily supplemented with one dose of the original group of drugs."
